import React from "react";

class NotFound extends React.Component {
  render() {
    return (
      <>
        <h1>404 not found</h1>
        <p>お探しのページは見つかりませんでした。</p>
        <div>
          <Link to={`/`}>ホームへ</Link>
        </div>
      </>
    );
  }
}

export default NotFound;
